\t\t\tbreak","\t\tfi","\tdone","}","","generate_localegen () {","\tcat <<EOF > locale.gen","ar_EG.UTF-8 UTF-8","en_US.UTF-8 UTF-8","en_GB.UTF-8 UTF-8","en_CA.UTF-8 UTF-8","en_SG.UTF-8 UTF-8","es_MX.UTF-8 UTF-8","zh_CN.UTF-8 UTF-8","fr_FR.UTF-8 UTF-8","ru_RU.UTF-8 UTF-8","ru_UA.UTF-8 UTF-8","es_ES.UTF-8 UTF-8","de_DE.UTF-8 UTF-8","pt_BR.UTF-8 UTF-8","it_IT.UTF-8 UTF-8","id_ID.UTF-8 UTF-8","ja_JP.UTF-8 UTF-8","bg_BG.UTF-8 UTF-8","pl_PL.UTF-8 UTF-8","da_DK.UTF-8 UTF-8","ko_KR.UTF-8 UTF-8","tr_TR.UTF-8 UTF-8","hu_HU.UTF-8 UTF-8","cs_CZ.UTF-8 UTF-8","bn_IN UTF-8","hi_IN UTF-8","EOF","}","","generate_mirrorlist () {","\tcat <<EOF > mirrorlist","Server = https://arch.midov.pl/arch/\\$repo/os/\\$arch","Server = https://mirror.osbeck.com/archlinux/\\$repo/os/\\$arch","Server = https://md.mirrors.hacktegic.com/archlinux/\\$repo/os/\\$arch","Server = https://mirror.sunred.org/archlinux/\\$repo/os/\\$arch","Server = https://mirror.ubrco.de/archlinux/\\$repo/os/\\$arch","Server = https://mirrors.qontinuum.space/archlinux/\\$repo/os/\\$arch","Server = https://mirror.f4st.host/archlinux/\\$repo/os/\\$arch","Server = https://arch.jensgutermuth.de/\\$repo/os/\\$arch","Server = https://mirrors.uni-plovdiv.net/archlinux/\\$repo/os/\\$arch","Server = https://mirror.hackingand.coffee/arch/\\$repo/os/\\$arch","EOF","}","","cd \"${script_dir}\" || exit 1","","bootstrap=\"${script_dir}\"/root.x86_64","","curl -#LO 'https://cdn-mirror.chaotic.cx/chaotic-aur/chaotic-keyring.pkg.tar.zst'","curl -#LO 'https://cdn-mirror.chaotic.cx/chaotic-aur/chaotic-mirrorlist.pkg.tar.zst'","","if [ ! -s chaotic-keyring.pkg.tar.zst ] || [ ! -s chaotic-mirrorlist.pkg.tar.zst ]; then","\techo \"Seems like Chaotic-AUR keyring or mirrorlist is currently unavailable\"","\techo \"Please try again later\"","\texit 1","fi","","bootstrap_urls=(\"mirror.f4st.host\" \\","\t\t\t\"arch.hu.fo\" \\","\t\t\t\"mirror.cyberbits.eu\" \\","\t\t\t\"mirror.osbeck.com\" \\","\t\t\t\"mirror.lcarilla.de\" \\","\t\t\t\"mirror.moson.org\")","","echo \"Downloading Arch Linux bootstrap\"","","for link in \"${bootstrap_urls[@]}\"; do","\tcurl -#LO \"https://${link}/archlinux/iso/latest/archlinux-bootstrap-x86_64.tar.gz\"","\tcurl -#LO \"https://${link}/archlinux/iso/latest/sha256sums.txt\"","","\tif [ -s sha256sums.txt ]; then","\t\tgrep bootstrap-x86_64 sha256sums.txt > sha256.txt","","\t\techo \"Verifying the integrity of the bootstrap\"","\t\tif sha256sum -c sha256.txt &>/dev/null; then","\t\t\tbootstrap_is_good=1","\t\t\tbreak","\t\tfi","\tfi","","\techo \"Download failed, trying again with different mirror\"","done","","if [ -z \"${bootstrap_is_good}\" ]; then","\techo \"Bootstrap download failed or its checksum is incorrect\"","\texit 1","fi","","rm -rf \"${bootstrap}\"","tar xf archlinux-bootstrap-x86_64.tar.gz","rm archlinux-bootstrap-x86_64.tar.gz sha256sums.txt sha256.txt","","mount_chroot","","generate_localegen","","if command -v reflector 1>/dev/null; then","\techo \"Generating mirrorlist...\"","\treflector --connection-timeout 10 --download-timeout 10 --protocol https --score 7 --sort rate --save mirrorlist","\treflector_used=1","else","\tgenerate_mirrorlist","fi","","rm \"${bootstrap}\"/etc/locale.gen","mv locale.gen \"${bootstrap}\"/etc/locale.gen","","rm \"${bootstrap}\"/etc/pacman.d/mirrorlist","mv mirrorlist \"${bootstrap}\"/etc/pacman.d/mirrorlist","","{","\techo","\techo \"[multilib]\"","\techo \"Include = /etc/pacman.d/mirrorlist\"","} >> \"${bootstrap}\"/etc/pacman.conf","","run_in_chroot pacman-key --init","echo \"keyserver hkps://keyserver.ubuntu.com\" >> \"${bootstrap}\"/etc/pacman.d/gnupg/gpg.conf","run_in_chroot pacman-key --populate archlinux","","# Add Chaotic-AUR repo","run_in_chroot pacman-key --recv-key 3056513887B78AEB","run_in_chroot pacman-key --lsign-key 3056513887B78AEB","","mv chaotic-keyring.pkg.tar.zst chaotic-mirrorlist.pkg.tar.zst \"${bootstrap}\"/opt","run_in_chroot pacman --noconfirm -U /opt/chaotic-keyring.pkg.tar.zst /opt/chaotic-mirrorlist.pkg.tar.zst"